const Colors = {
  "icon-lizard.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(261, 73%, 60%) 50%)",
    boxShadow: "inset -1px -12px 1px hsl(261, 60%, 45%)",
  },
  "icon-paper.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(230, 89%, 62%) 50%)",
    boxShadow: "inset -1px -10px 1px hsl(230, 89%, 45%)",
  },
  "icon-rock.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(349, 71%, 52%) 50%)",
    boxShadow: "inset -1px -10px 1px hsl(349, 70%, 40%)",

  },
  "icon-scissors.svg": {
    gradient: "radial-gradient(circle, white 53%, hsl(39, 89%, 49%) 50%)",
    boxShadow: "inset -1px -10px 1px hsl(39, 89%, 35%)",
  },
